import { useState } from 'react';
import Input from '../../components/utils/regex/input';
import Api from '../../services/api';

import './style.css';


export default function Register() {

  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [crm, setCrm] = useState('');
  const [cpf, setCpf] = useState('');
  const [phone, setPhone] = useState('');
  const [specialization, setSpecialization] = useState('');


  async function handleSumbmit() {
    const data = {
      name: name,
      email: email,
      password: password,
      crm: crm,
      cpf: cpf,
      phone: phone
    }
    const response = await Api.post('doctorSignUp', data);
    if (response.status === 201) {
      window.location.href = '/'
    } else {
      alert('Erro ao cadastrar o usuário!');
    }
    console.log(data);

  }

  function validate(values) {
    const errors = {};
    if (!values.phoneOne) {
      errors.phoneOne = "Telefone é obrigatório";
    } if (!values.crm) {
      errors.crm = "Crm é obrigatório";
    } if (!values.cpf) {
      errors.cpf = "Cpf é obrigatório";
    } if (!values.specialization) {
      errors.specialization = "Especialização é obrigatório";
    } if (!values.name) {
      errors.name = "Nome é obrigatório";
    } if (!values.email) {
      errors.email = "Email é obrigatório";
    }
    return errors;
  }
  return (
    <div className={"Principal"}>

      <div> <a href="/"><img src="https://i.imgur.com/tDvwyyA.png" className={'logo'} title="source: imgur.com" /></a></div>
      <h1>Cadastro</h1>
      <h2>Preencha as Informações abaixo</h2>
      <br></br>
      <br></br>

      <form className={"divCenter"}>
        <div >
          <label className={"text"}>Nome</label>
          <br></br>
          <Input name="name" id="name" type="text" value={name}
            onChange={e => setName(e.target.value)} />
        </div>
        <br></br>
        <div>
          <label className={"text"}>Email</label>
          <br></br>
          <Input name="email" id="email" value={email}
            onChange={e => setEmail(e.target.value)} type="text" />
        </div>
        <div>
          <label className={"text"}>CPF</label>
          <br></br>
          <Input mask="cpf" name="cpf" type="text" id="cpf" value={cpf}
            onChange={e => setCpf(e.target.value)} />
        </div>
        <div>
          <label className={"text"}>CRM</label>
          <br></br>
          <Input mask="crm" id="crm" name="crm" type="text" value={crm}
            onChange={e => setCrm(e.target.value)} />
        </div>
        <div>
          <label className={"text"}>Especialização</label>
          <br></br>
          <Input name="specialization" id="crm" type="text" value={specialization}
            onChange={e => setSpecialization(e.target.value)} />
        </div>
        <div>
          <label className={"text"}>Telefone</label>
          <br></br>
          <Input mask="telefone" id="phone" name="phoneOne" type="text" value={phone}
            onChange={e => setPhone(e.target.value)} />
        </div>
        <div>
          <label className={"text"}>Senha</label>
          <br></br>
          <Input mask="password" id="password" name="password" type="password" value={password}
            onChange={e => setPassword(e.target.value)} />
          <br></br>
          <button type="submit" onClick={handleSumbmit}>Enviar</button>
        </div>
      </form>
    </div>
  );
}
